import { useEffect, useState } from 'react'
import axios from 'axios'

export default function usePokemonSearch(query) {

    useEffect(()=>{
        // let cancel
        axios({
            method: 'GET',
            url:'/assets/pokeNames.json',
            params: { q: query}
        }).then(res =>{
            console.log(res)
        })
    })

  return null
}
